script: |
  super -f text -I q6680.spq | sort > q6680.out

inputs:
  - name: q6680.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col1 NOT BETWEEN - - col2 - - 97 + - col2 * + 25 + - 17 AND + + col0;
  - name: tab2

outputs:
  - name: q6680.out
    data: |
      75	67	58
